import React, { PureComponent } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip} from 'recharts';

const data = [
  { name: 'Tháng 1', uv: 4000 },
  { name: 'Tháng 2', uv: 3000 },
  { name: 'Tháng 3', uv: 2000 },
  { name: 'Tháng 4', uv: 4000 },
  { name: 'Tháng 5', uv: 3000 },
  { name: 'Tháng 6', uv: 2000 },
  { name: 'Tháng 7', uv: 4000 },
  { name: 'Tháng 8', uv: 3000 },
  { name: 'Tháng 9', uv: 2000 },
  { name: 'Tháng 10', uv: 4000 },
  { name: 'Tháng 11', uv: 3000 },
  { name: 'Tháng 12', uv: 2000 }
];

export default class Chart2 extends PureComponent {
  render() {
    return (
      <div style={{ width: '100%' }}>
          <LineChart
            width={800}
            height={300}
            data={data}
            margin={{
              top: 10,
              right: 30,
              left: 0,
              bottom: 0,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Line type="monotone" dataKey="uv" stroke="#8884d8" fill="#8884d8" />
          </LineChart>
      </div>
    );
  }
}
